import React, { Component, Fragment } from "react";
import "./embeddedVideo.css";
class EmbeddedVideo extends Component {
  render() {
    return (
      <iframe
        title="Random Video"
        height="500"
        width="850"
        src={this.props.url}
      />
    );
  }
}
export default EmbeddedVideo;
